campaignTrail_temp.questions_json = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 717, \"fields\": {\"priority\": 1, \"description\": \"January 2021: The CDU is looking for a new party leader at their party congress after the resignation of Annegret Kramp-Karrenbauer. After passing up a bid in the former contest in 2018, you feel like now is the time to strike. How do you want to convince the delegates to vote for you instead of Friedrich Merz or Norbert Röttgen?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 718, \"fields\": {\"priority\": 1, \"description\": \"Congratulations, you are now party leader of the Christian Democratic Union. You are not the official chancellor candidate of the Union of CDU and CSU yet, but hopefully, that will just be a formality. What will be your emphasis in your work for the party?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 719, \"fields\": {\"priority\": 1, \"description\": \"March 2021: COVID-19 has shaped the lives of people in Germany and across the world for the past years. Now that the winter is over, a lot of people are demanding an end to the harsh lockdowns. As Minister-President of North Rhine-Westphalia, you could chart a new course for your government. What is your stance on this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 720, \"fields\": {\"priority\": 1, \"description\": \"You’ve been invited to a talk show to talk about tax policy and the “Black Zero”, which mandates a balanced budget. The left and left-of-centre seeks more investments, paid for by taxing the rich, while the FDP seeks widespread tax reductions. How do you want to frame the position of your party?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 721, \"fields\": {\"priority\": 1, \"description\": \"Shook to your core, you read the headline of the 11/2021 issue of<i> Der Spiegel. “‘Schwarzer Filz’ - Mask deals, venality, failure in crisis: the deep fall of the Union”. </i> They reveal how several CDU/CSU MPs are implicated as part of a corrupt scheme to sell overpriced medical masks to government organizations. Journalists run in your door.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 722, \"fields\": {\"priority\": 1, \"description\": \"April 2021: Minister of Finance and current Vice Chancellor Olaf Scholz has been declared chancellor candidate by the SPD last year already and there are rumours the Green party is about to nominate either Annalena Baerbock or Robert Habeck soon. Do you want to formally declare your candidacy before they do?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 723, \"fields\": {\"priority\": 1, \"description\": \"You and Söder both want to become the chancellor candidate for the Union of CDU/CSU. Both of you have supporters and detractors within the party. How do you want to decide this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 724, \"fields\": {\"priority\": 1, \"description\": \"Wow, that was a close one! First, let’s take a breath.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 725, \"fields\": {\"priority\": 1, \"description\": \"The Green party has, for the first time in its history, nominated a chancellor candidate, Annalena Baerbock. In a development few would have expected four years ago, she appears to be your main contender, even polling ahead of you sometimes, while Olaf Scholz of the SPD is far behind in third place. What’s your strategy regarding your two opponents?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 726, \"fields\": {\"priority\": 1, \"description\": \"Michael Kretschmer, your party colleague and Minister-President of Saxony, has recently travelled to Moscow and has been criticized for that visit. What’s your stance on Germany’s relationship with Russia and Putin?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 727, \"fields\": {\"priority\": 1, \"description\": \"May 2021: A bombshell has rocked the Grand Coalition: the Federal Constitutional Court just ruled the Climate Protection Act unconstitutional and demands the government do more to lower emissions. Berlin has already gone to work on making the law stricter. What is your opinion on this issue?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 728, \"fields\": {\"priority\": 1, \"description\": \"More and more people are receiving a Covid vaccine, though not everyone has been granted access yet. Older people are starting to get the shot, while some who are younger are frustrated to wait. Do you have a comment on how to move forward with the vaccination campaign?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 729, \"fields\": {\"priority\": 1, \"description\": \"You have been invited to give a speech about German foreign and defence policy before some members of the Bundeswehr. What talking points do you want to emphasize?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 730, \"fields\": {\"priority\": 1, \"description\": \"June 2021: Things look to be on somewhat of an upswing. Baerbock is working herself through some scandals, and on top, the CDU was the big winner at the provincial elections in Saxony-Anhalt, with Minister-President Reiner Haseloff massively increasing the vote share of the CDU. How do you approach this situation?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 731, \"fields\": {\"priority\": 1, \"description\": \"Digitalization is an important topic in this election, with Germany often perceived as surprisingly archaic in comparison to its neighbours, frequently seen on the tail end of statistics. With all parties unveiling plans to rectify this, what focus do you want to lay?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 732, \"fields\": {\"priority\": 1, \"description\": \"July 2021: Widespread flooding is affecting large areas of western, southern and middle Germany. The state you govern, North Rhine-Westphalia, is among the most affected. Do you have a first statement?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 733, \"fields\": {\"priority\": 1, \"description\": \"Post-flood cleanup operations are going on as the full devastation of the flooding becomes clear. Many advisors urge you to get out and show yourself as a man of action.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 734, \"fields\": {\"priority\": 1, \"description\": \"Climate change is a much-discussed topic again after the floodings. You have been asked to clarify your stance on how to best combat climate change.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 735, \"fields\": {\"priority\": 1, \"description\": \"After early successes, the vaccination campaign has become sluggish in recent weeks. Some politicians are going so far as to demand making the vaccine mandatory.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 736, \"fields\": {\"priority\": 1, \"description\": \"August 2020: The SPD has been surging in the polls, drawing votes from both you and the Green Party. There are still many undecided voters too, though. Now it’s time to produce a video spot to advertise during the home stretch of this campaign and hopefully sway some people.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 737, \"fields\": {\"priority\": 1, \"description\": \"It is basically guaranteed that there will be a coalition government after the elections. Which party would you be willing to govern with?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 738, \"fields\": {\"priority\": 1, \"description\": \"Pictures of the disastrous retreat of NATO troops from Afghanistan go around the globe. The government is sharply criticised for its botched evacuation. What do you want to emphasize in this situation?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 739, \"fields\": {\"priority\": 1, \"description\": \"September 2021: For the first time in German history, there will be a three-way debate, a so-called “Triell”. You, Scholz of the SPD and Baerbock of the Green party are all invited. What do you want to focus on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 740, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on Olaf Scholz, vice chancellor and candidate of the SPD. What do you want to attack him on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 743, \"fields\": {\"priority\": 1, \"description\": \"Finally, this campaign is coming to an end. Do you have anyone, in particular, you want to campaign with during the last days before the election?\", \"likelihood\": 1.0}}]");
extraQuestions = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 741, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on Annalena Baerbock, chancellor candidate of the Green party. What do you want to attack her on?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 742, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on presenting your case to the German people without too strong attacks. What are your main points?\", \"likelihood\": 1.0}}]");
campaignTrail_temp.answers_json = JSON.parse("[{\"model\": \"campaign_trail.answer\", \"pk\": 4000, \"fields\": {\"question\": 717, \"description\": \"I am Minister-President of North Rhine-Westphalia, the most populous state in Germany. None of my opponents has held a political office in the last few years - I will bring my expertise to the national level.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4001, \"fields\": {\"question\": 717, \"description\": \"Out of the three candidates nominated, I am the only one who has actually won an election and in a former SPD-stronghold nonetheless. It is crucial that we win the Bundestagswahl this fall, and I am the right man to do it!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4002, \"fields\": {\"question\": 717, \"description\": \"I am more conservative than Röttgen and more liberal than Merz. By positioning myself between those two, I will draw votes from whoever is knocked out on the first ballot and win on the second ballot.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4003, \"fields\": {\"question\": 717, \"description\": \"The party officials are largely behind me. They should push for me behind closed doors to make sure I win this contest. I will already focus on convincing swing voters for the election.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4004, \"fields\": {\"question\": 718, \"description\": \"I want to continue the legacy of the Merkel-era as much as possible. Her sixteen years of chancellorship were outstanding, and I promise to continue on that course.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4005, \"fields\": {\"question\": 718, \"description\": \"The CDU is the party for the middle of society. I will continue moving the party into the future, with a moderate and pragmatic course on the issues of the day.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4006, \"fields\": {\"question\": 718, \"description\": \"The strong showing of Merz has shown that the right wing of the party has too often been ignored by Merkel. Under my leadership, we will bring the party back on a more conservative path.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4007, \"fields\": {\"question\": 718, \"description\": \"I want to single out climate change as the most important issue facing our society in the coming years. It is important that we don’t leave this topic to other parties, but present solutions of our own.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4008, \"fields\": {\"question\": 719, \"description\": \"While the lockdowns were the right thing to do, now that the winter is over and we have started to vaccinate people, it is time to return to normalcy. North Rhine-Westphalia will open up quickly.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4009, \"fields\": {\"question\": 719, \"description\": \"The situation is still very volatile and it is better to be cautious than reckless. We should keep the lockdowns for the foreseeable future, and only open up on strict criteria.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4010, \"fields\": {\"question\": 719, \"description\": \"While I’m all for opening up, we should keep an eye on the number of infected people and have a bridge lockdown during Easter if the case numbers become too high.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4011, \"fields\": {\"question\": 719, \"description\": \"This is a decision that the federal government and the states have to make together. I will wait and see what this process achieves and go with the majority opinion.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4012, \"fields\": {\"question\": 720, \"description\": \"Under no circumstances will we raise taxes, but we don’t want to dramatically lower them. We will phase out the extra tax of the Soli and try to reduce the burden on small and medium-income earners while always keeping the budget balanced, in keeping with the “Black Zero”.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4013, \"fields\": {\"question\": 720, \"description\": \"The Covid crisis has left a massive hole in our budget that we have to plug somehow. We have to be measured, but a tax increase will likely be necessary to avoid any unnecessary debts.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4014, \"fields\": {\"question\": 720, \"description\": \"Taxes for private households should stay where they are or even be lowered by phasing out the Soli. More importantly, corporate taxes should be lowered to unleash the full economic potential of this country. As little State as necessary, as much market as possible.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4015, \"fields\": {\"question\": 720, \"description\": \"To stimulate the economy after the Covid crisis, taxes have to be lowered across the board for both private households and corporations. We also have to streamline tax bureaucracy, maybe looking at a flat tax.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4016, \"fields\": {\"question\": 721, \"description\": \"I was as shocked as everyone else when I found out about this! The parliamentary immunity of these MPs should promptly be removed so they can be properly investigated. Corruption has no place in the CDU/CSU!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4017, \"fields\": {\"question\": 721, \"description\": \"Let’s wait and see how this develops. I’ll issue a brief statement that we want to wait until it’s clear what actually happened.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4018, \"fields\": {\"question\": 721, \"description\": \"This is nothing but a political hit job by a left-wing magazine in an election year. I’m sure further investigations will prove the innocence of these MPs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4019, \"fields\": {\"question\": 721, \"description\": \"Let us be pragmatic. Two of our MPs may have indeed shown low moral inhibitions, but we shouldn’t judge the whole party based on the actions of two people. We support this investigation as much as anyone else, these are individual black sheep.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4020, \"fields\": {\"question\": 722, \"description\": \"This seems like a good time to declare my candidacy, yes. Though before I declare, I will call Markus Söder, the party leader of our sister party, the CSU, to make sure he won’t oppose me.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4021, \"fields\": {\"question\": 722, \"description\": \"Yes, I will inform the upper party echelons and formally announce this during a press conference in my home state. There is no time to lose!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4022, \"fields\": {\"question\": 722, \"description\": \"You know, it might be better to wait this out a bit longer. I can declare after whatever announcement the Green party makes to get them out of the limelight.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4023, \"fields\": {\"question\": 723, \"description\": \"Actually, I thought about this long and hard, and I want to retract my candidacy. Söder has better polling numbers, many of our party members support him and I’m quite happy here serving as Minister-President of North Rhine-Westphalia.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4024, \"fields\": {\"question\": 723, \"description\": \"Let’s call every big name in the party, curry every favour maybe we can even get Merkel herself to weigh in. I can’t have this decided by vote, I want this decided by the party elites now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4025, \"fields\": {\"question\": 723, \"description\": \"The party parliamentary group of CDU and CSU shall vote on this. I’m confident they will pick me over Söder - his support primarily comes from Bavaria and I have the traditional prerogative as leader of the bigger party.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4026, \"fields\": {\"question\": 723, \"description\": \"The party parliamentary group of CDU and CSU shall vote on this. I’m confident they will pick me over Söder - his support primarily comes from Bavaria and I have the traditional prerogative as leader of the bigger party.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4027, \"fields\": {\"question\": 724, \"description\": \"First and foremost, I want to thank Markus Söder for accepting the result. We have to be united as a party to win this fall. Apart from that, I will hit my usual talking points, about stability, pragmatism, praising Merkel and acting on our values.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4028, \"fields\": {\"question\": 724, \"description\": \"This closer-than-expected contest has convinced me that I need to move my position and change my attitude on some topics. I’ll focus on how dealing with the pandemic and not opening up too quickly is of critical importance, how we need strong leadership in these trying times and new ideas to move forward, to build on Angela Merkel's successes.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4029, \"fields\": {\"question\": 724, \"description\": \"I will give a largely non-political speech. We need to focus on the importance of cohesion and trust in our society, to come together as one in the wake of this crisis, not letting our different views divide us, and the values of hard work. I want to bring up the anecdote about my father, who was a miner.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4030, \"fields\": {\"question\": 724, \"description\": \"Now is the perfect opportunity to emphasize that this country is in dire need of change and a new direction, away from the Status Quo. I will promise to modernize Germany while letting our values guide us in this progress. A new Germany, responsible, sensible and conservative.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4031, \"fields\": {\"question\": 725, \"description\": \"The Green party is always surging a few months before elections and comes crashing down in time, just like in 2011 after Fukushima. I’m not too worried - we should still focus more on competing with the SPD, our traditional opponent.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4032, \"fields\": {\"question\": 725, \"description\": \"I will take this development very seriously, clearly the demand is there to take the climate more seriously. Let’s unveil some of our own environmental policies to stop their momentum and defuse some of their criticisms.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4033, \"fields\": {\"question\": 725, \"description\": \"Off the record, it’s not the worst thing that these two parties compete for centre-left votes. This makes the path to first place a lot easier. Let’s focus somewhat on the Greens as our main contender in that regard, and just attack them where we can.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4034, \"fields\": {\"question\": 725, \"description\": \"Actually, this is a bit ridiculous and reminds me of the publicity stunt the FDP pulled in 2002 when they nominated Guido Westerwelle as chancellor candidate. Let’s mock them for their hubris and don’t refer to Baerbock as a legitimate chancellor candidate.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4035, \"fields\": {\"question\": 726, \"description\": \"It is important that we don’t demonize Putin and keep our dialogue open. I’m critical of many things the Russian leadership has done, but overall, we should strive to cooperate with them, as we do on the Nord-Stream 2 pipeline.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4036, \"fields\": {\"question\": 726, \"description\": \"I’ve been more lenient in the past, but enough is enough. I will join in with the criticism against Kretschmer and call for a tougher stance towards Putin. Maybe we should only open the Nord-Stream 2 pipeline if we get some concessions from Russia.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4037, \"fields\": {\"question\": 726, \"description\": \"Kretschmer is completely right, we have to talk more with Russia, not less. I’m all in favour of more dialogue and stronger economic ties with Russia. Besides, it’s not like the USA has never done anything wrong.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4038, \"fields\": {\"question\": 726, \"description\": \"This whole thing is overblown, this trip was mostly for cultural exchange. I don’t have much to say about this. We stand on our commitment to Nato.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4039, \"fields\": {\"question\": 727, \"description\": \"This was a bad decision by the court. The Climate Protection Act already went far enough and I’m not in favour of hurting the economy with a strict climate policy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4040, \"fields\": {\"question\": 727, \"description\": \"It is important that we quickly implement the new law. I’m especially in favour of a price for CO<sub>2</sub> that is formed by market forces. We have to make sure that everyone can keep affording their energy bills, though, and we need to use this opportunity to create new jobs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4041, \"fields\": {\"question\": 727, \"description\": \"We have to become carbon neutral long before 2050. I’m sure the government under Merkel will come up with a sensible solution, which I will continue as chancellor.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4042, \"fields\": {\"question\": 727, \"description\": \"With the decision by the court, we now have a great opportunity for an ambitious new Climate Protection Act. I advocate for Germany to be carbon neutral by 2040 and to accelerate the transition to renewable energies. We simply can’t wait anymore.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4043, \"fields\": {\"question\": 728, \"description\": \"We need to open up quickly for vaccinated people. A return to normalcy has never been so close, and we all had more than enough of lockdowns - not every measure might still be proportionate. Vaccinated people have less risk and thus should receive more benefits.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4044, \"fields\": {\"question\": 728, \"description\": \"We are currently in a very critical phase of the pandemic, a phase in which cohesion could easily be endangered. Vaccinated people should be exempt from some restrictions, but let’s not go overboard. We need to move forward together and be patient until science tells us that it’s safe.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4045, \"fields\": {\"question\": 728, \"description\": \"It’s important that as many people as possible get vaccinated as quickly as possible so we can overcome this crisis. Maybe we should rethink the prioritization system we have right now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4046, \"fields\": {\"question\": 728, \"description\": \"The vaccine seems helpful now, but we haven’t had a chance to study its side effects yet. I advocate for a slowdown of the vaccination campaign until we have more information.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4047, \"fields\": {\"question\": 729, \"description\": \"For years and years, we have consistently missed the NATO aim to spend 2% of our gross domestic product on defence. I strongly reaffirm our commitment to NATO and this goal! The West has to be united against potential threats.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4048, \"fields\": {\"question\": 729, \"description\": \"While I strongly reaffirm our support of a united Alliance and strong defense, I specifically want to call out Annalena Baerbock. She lacks a clear commitment to NATO, which is not appropriate for a chancellor.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4049, \"fields\": {\"question\": 729, \"description\": \"Our defence policy is adequate as it is right now. While I want to strongly reaffirm my commitment to NATO, we don’t need to spend more on defence than we do right now, we need to combat waste first and foremost.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4050, \"fields\": {\"question\": 729, \"description\": \"NATO is a relic of the cold war. We should stay a member for now, but we should also try to find avenues for cooperating with other nations, keep reaffirming our neutrality, and open up new dialogues with Russia or China.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4051, \"fields\": {\"question\": 730, \"description\": \"I want to congratulate Haseloff for his strong performance. It shows that the citizens still trust the CDU to be the best governing party, and we want to emulate his strategy on a national scale.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4052, \"fields\": {\"question\": 730, \"description\": \"Haseloff performed very well, but I want to emphasize that the AfD lost votes. When we keep appealing to all people, without prejudice, we can win them back for the democratic parties.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4053, \"fields\": {\"question\": 730, \"description\": \"This was a very strong performance. To show my gratitude, I will make an extra trip to Saxony-Anhalt and campaign with him for some nice pictures.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4054, \"fields\": {\"question\": 731, \"description\": \"The pandemic has shown how ill-prepared our schools are. We need to continue improving digital infrastructure in education, through more training, technical assets or a national educational platform. That is what the CDU/CSU has worked on, and will continue doing.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4055, \"fields\": {\"question\": 731, \"description\": \"Actually, we don’t have much to gain by talking about this topic - many voters see us as responsible for the current situation. Let’s downplay it as much as we can and focus on issues where we are seen as more competent, like matters of security or debt.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4056, \"fields\": {\"question\": 731, \"description\": \"We definitely need to modernize the digital infrastructure of Germany, especially in the public sector. Administrative processes have to be more accessible to citizens, w and we have to cut down on bureaucracy\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4057, \"fields\": {\"question\": 731, \"description\": \"Digitalization is an important topic for us, and I want to especially emphasize that we need to finish the nationwide 5G mobile network by 2025.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4058, \"fields\": {\"question\": 732, \"description\": \"The most important thing we can do right now is help the affected regions with their crisis management. They need help quickly and unbureaucratically.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4059, \"fields\": {\"question\": 732, \"description\": \"I want to praise local teams and local reactions. Some areas already had crisis teams ready when the sun was still shining and no one knew what would happen. I’m promising swift help for everyone affected.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4060, \"fields\": {\"question\": 732, \"description\": \"First, we need to help the affected regions with the cleanup. After that, we have to guarantee financial emergency aid for affected people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4061, \"fields\": {\"question\": 732, \"description\": \"Extreme weather events are unfortunately going to become more common due to climate change. This has shown us that we need to act decisively to now to keep global warming below 1.5°C.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4062, \"fields\": {\"question\": 733, \"description\": \"Actually, I don’t want to be seen as performative. I will keep coordinating the crisis efforts from the state chancellery.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4063, \"fields\": {\"question\": 733, \"description\": \"I want to get out there, yes, but let’s try to keep my visits below the radar so we don’t generate much media buzz.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4064, \"fields\": {\"question\": 733, \"description\": \"What a great idea! Let’s go visit some of the affected towns with German President Steinmeier.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4065, \"fields\": {\"question\": 733, \"description\": \"What a great idea! Let’s go visit some of the affected towns with German President Steinmeier.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4066, \"fields\": {\"question\": 734, \"description\": \"The floodings have shown that we need to be much more ambitious than before! For example, we need to stop using coal for energy generation by 2030.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4067, \"fields\": {\"question\": 734, \"description\": \"Climate change is coming, whether we want it or not. The most important thing we can do is mitigate its worst effects to prevent catastrophes like this from doing too much damage.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4068, \"fields\": {\"question\": 734, \"description\": \"Let us not be impulsive here. Just because today is a day like this, you don't change politics. Our current climate legislation is sufficient.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4069, \"fields\": {\"question\": 734, \"description\": \"We need to do more to reduce our carbon emissions. Maybe we have to rethink the decision to exit nuclear energy before coal after recent events.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4070, \"fields\": {\"question\": 735, \"description\": \"Compulsion is the wrong way to go about this. Instead, we need to convince people and continue our information campaign.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4071, \"fields\": {\"question\": 735, \"description\": \"While I wouldn’t go that far, we can give people more incentives to get vaccinated, like opening up things only for vaccinated and recovered people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4072, \"fields\": {\"question\": 735, \"description\": \"Covid is basically over, the case numbers are very low. I question if we need this expensive vaccination campaign at all.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4073, \"fields\": {\"question\": 735, \"description\": \"I also think this is a good idea. We need to do everything we can to finally make Covid history.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4074, \"fields\": {\"question\": 736, \"description\": \"Let’s incorporate some biographical elements, like that my father was a miner, and show how I closed the last mine in North Rhine-Westphalia. Then let’s talk about the importance of tackling climate change.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4075, \"fields\": {\"question\": 736, \"description\": \"Covid is still on the minds of most people. Let’s focus on this and promise that I’m the one to bring normalcy back.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4076, \"fields\": {\"question\": 736, \"description\": \"It’s best to play it safe. A spot about how I’m bringing different people together and how our country needs strong solidarity.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4077, \"fields\": {\"question\": 736, \"description\": \"I’ve been governing North Rhine-Westphalia successfully since 2017. I want to show my successes here and promise to bring them to Germany.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4078, \"fields\": {\"question\": 737, \"description\": \"We will talk with all democratic parties - the SPD, the Greens and the FDP. Unfortunately, not all parties will rule out coalition talks with the extremist Left party.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4079, \"fields\": {\"question\": 737, \"description\": \"The grand coalition of the last 8 years is increasingly unpopular. We need to find a different governing majority.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4080, \"fields\": {\"question\": 737, \"description\": \"Actually, this new party spectrum needs new solutions. I think a Bahamas coalition with the AfD and the FDP could work.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4081, \"fields\": {\"question\": 737, \"description\": \"My favourite coalition would be black-yellow, like the one I’m leading in North Rhine-Westphalia now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4082, \"fields\": {\"question\": 738, \"description\": \"This is the biggest debacle for NATO since its founding. We now have to analyse what went wrong and how we can avoid such situations in the future.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4083, \"fields\": {\"question\": 738, \"description\": \"We need to take in more refugees from Afghanistan, especially people who cooperated with the German troops. We owe it to these people after they helped us!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4084, \"fields\": {\"question\": 738, \"description\": \"The foreign ministry under SPD control is clearly to blame for our part in this crisis. They should have started the evacuations much earlier.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4085, \"fields\": {\"question\": 738, \"description\": \"We can’t have a repeat of the refugee crisis of 2015. We need to take it some refugees, yes, but avoid pictures like that at all costs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4086, \"fields\": {\"question\": 739, \"description\": \"Scholz has been surging a lot in the polls recently and I worry that he will not stop. It seems foolish to do anything but attack him.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4087, \"fields\": {\"question\": 739, \"description\": \"Baerbock has been struggling lately, but I’m still worried about the Green Party pulling away votes from us. Let’s focus on her.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4088, \"fields\": {\"question\": 739, \"description\": \"I will leave petty attacks to my opponents and focus more on policy. I’m certain the German people will appreciate hearing concrete solutions to their problems more than attacks.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4089, \"fields\": {\"question\": 739, \"description\": \"Actually, I don’t want two left-wing politicians to gang up on me. Let the two of them duke it out, I won’t attend this so-called Triell.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4090, \"fields\": {\"question\": 740, \"description\": \"He likes to present himself as a moderate, but he hasn’t completely ruled out a coalition with the extremist Left party. Can voters really trust him not to form this coalition after the election?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4091, \"fields\": {\"question\": 740, \"description\": \"Let’s hit him on his scandals as finance minister. Under his watch, Wirecard collapsed due to fraudulent dealings and lots of people lost their money. There was even a police raid on a government office belonging to his ministry.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4092, \"fields\": {\"question\": 740, \"description\": \"The program of his party is very leftwing, especially regarding pensions and the minimum wage. It shows that the SPD as a whole is unfit to govern.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4093, \"fields\": {\"question\": 740, \"description\": \"Actually, I’ve changed my mind. I’m just going to present myself as calm and above petty attacks.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4094, \"fields\": {\"question\": 741, \"description\": \"She’s had some problems with plagiarism in a book she’s written and inflated her CV. These might seem like minor things, but can she really be trusted to govern this country?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4095, \"fields\": {\"question\": 741, \"description\": \"Everyone on this stage agrees that something has to be done about climate change, but trying to forbid everything as Mrs Baerbock and her party want can’t be the solution!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4096, \"fields\": {\"question\": 741, \"description\": \"I’ll attack her for her willingness to govern with the radical Left party. This coalition is unpopular, moderates should be frightened by this prospect.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4097, \"fields\": {\"question\": 741, \"description\": \"Actually, I’ve changed my mind. I’m just going to present myself as calm and above petty attacks.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4098, \"fields\": {\"question\": 742, \"description\": \"I want to present myself as the candidate having the best market-focused and realistic solutions for climate change. We are on a good path and don’t need more government intervention and bans on things.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4099, \"fields\": {\"question\": 742, \"description\": \"With two left-leaning politicians debating with me, I will present myself as the voice of reason. For example, I have tax and social security plans that are actually affordable and generally promise sensible governance.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4100, \"fields\": {\"question\": 742, \"description\": \"I’m a known quantity and I’m the candidate who stands for a continuation of the Merkel years. With me, Germany will stay on a successful path.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4101, \"fields\": {\"question\": 742, \"description\": \"Actually, screw this! I will attack them both whenever an opportunity presents itself. That way, I can sharpen my profile and show myself as the most competent candidate.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4102, \"fields\": {\"question\": 743, \"description\": \"It’s important that all wings of our party stay united and motivated to vote. Let’s campaign with Friedrich Merz to show that I’m taking people like him and his positions seriously.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4103, \"fields\": {\"question\": 743, \"description\": \"Who else but Angela Merkel could be the right person? She has won the last four elections, and I want to show people that I’m the one to continue her legacy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4104, \"fields\": {\"question\": 743, \"description\": \"I’m worried about the AfD taking first place in some East German states. I want to campaign there with local CDU politicians like Haselhof and Kretschmer.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4105, \"fields\": {\"question\": 743, \"description\": \"Markus Söder and I didn’t always have the warmest relationship, but he is very popular in Bavaria. Let’s campaign with him there and show some unity between the CDU and CSU.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4106, \"fields\": {\"question\": 743, \"description\": \"While the results in Saxony-Anhalt are definitely praiseworthy, I want to focus on Baerbocks scandals. She has not been honest about her CV and has shamelessly plagiarized in her book. She shows serious concerns about her integrity that have to be called out.\"}}]");
