campaignTrail_temp.answer_feedback_json = JSON.parse("[{\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5000, \"fields\": {\"answer\": 4000, \"candidate\": 77, \"answer_feedback\": \"Although you eschew ideology, competence is a great argument and the reason why you were drafted in the first place. With no majority on the first ballot, you win against Merz on the second ballot.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5001, \"fields\": {\"answer\": 4001, \"candidate\": 77, \"answer_feedback\": \"Both Merz and Röttgen have been out of politics for a bit and haven’t proven their electability. With the CDU eager for a continuation of their dominance, you almost clinch the nomination on the first ballot and easily win the second.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5002, \"fields\": {\"answer\": 4002, \"candidate\": 77, \"answer_feedback\": \"Elections are won in the centre! While the party is not all that enthusiastic about you, you really do win on the second ballot against Merz, with Röttgens endorsement. Be sure to talk some straight talk though, lest your base asks for a stronger man to become chancellor…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5003, \"fields\": {\"answer\": 4003, \"candidate\": 77, \"answer_feedback\": \"Remember your poster from 2017: “The big whole starts with an ear for the smaller things”. While you’re perceived as arrogant and complacent, Friedrich Merz rises from the ashes as a “man of the people”. He beats you narrowly, and you can only watch from the sidelines as he tries to become chancellor this fall.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5004, \"fields\": {\"answer\": 4004, \"candidate\": 77, \"answer_feedback\": \"Adenauer's spirit praises you: “No experiments!” Angela Merkel is a popular chancellor and holds significant respect for middle-of-the-road voters. However, some perceive a certain stagnation in government in the last few years. Be sure to provide some vision for the future, or you won’t win anyone under the age of 50.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5005, \"fields\": {\"answer\": 4005, \"candidate\": 77, \"answer_feedback\": \"Right-wing culture warriors have already bled to the AfD, but your course does not convince them to come back. That said, you might not need them if you convince enough non-ideological voters of the need for stability - a big electoral prize in Germany.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5006, \"fields\": {\"answer\": 4006, \"candidate\": 77, \"answer_feedback\": \"After the leadership contest, mainstream media wonders why you’re caving so much. That said, taking back frustrated culture warriors might be good to keep the extreme right small, and your base certainly is excited. Be careful with your rhetoric though - lest you imitate them too much for the average voter.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5007, \"fields\": {\"answer\": 4007, \"candidate\": 77, \"answer_feedback\": \"“Laschets left-wing pivot”, the headline of <i>Der Spiegel </i> reads. That’s not necessarily meant as an insult - many outsiders tentatively praise your new outlook. It’s insiders though who worry that you’ve gone woke, especially in your sister party, the CSU. The AfD salivates at you leaving your right wing open to attacks.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5008, \"fields\": {\"answer\": 4008, \"candidate\": 77, \"answer_feedback\": \"Your approach backfires. As soon as the climate warms, cases are surging again, and you face harsh critiques for your carelessness. Political opponents from your left criticize you sharply, as does famous virologist Christian Drosten.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5009, \"fields\": {\"answer\": 4009, \"candidate\": 77, \"answer_feedback\": \"At first, people are grumbling, but when cases start to surge again in the spring, this looks like a good call. Not all are satisfied though - some view prolonged lockdowns as unconstitutional, especially in East Germany.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5010, \"fields\": {\"answer\": 4010, \"candidate\": 77, \"answer_feedback\": \"You manage well enough, but with your wishy-washy rhetoric, you come off as a bit too much of a people-pleaser. You perceive a hit in your statewide favorability for your lack of vision and communication.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5011, \"fields\": {\"answer\": 4011, \"candidate\": 77, \"answer_feedback\": \"People expect more leadership from a supposed future chancellor. While the measures are effective at keeping Covid at bay, and local outlets do give credit, this allows other political actors to outshine you - both inside and outside your party.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5012, \"fields\": {\"answer\": 4012, \"candidate\": 77, \"answer_feedback\": \"This is your expected position, and your colleague, former Minister of Finance and current President of the Bundestag Wolfgang Schäuble, architect of the “Black Zero”, thanks you in private. These proposals aren’t exactly unpopular, but a visionary you are not.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5013, \"fields\": {\"answer\": 4013, \"candidate\": 77, \"answer_feedback\": \"A brutally honest answer, but honesty isn’t always well received, as the FDP and AfD make hay from disappointed market liberals. Leftists aren’t going to vote for you on that promise either. You should probably tread more lightly with unpopular policies so shortly before the election, much as your heart might be in the right place.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5014, \"fields\": {\"answer\": 4014, \"candidate\": 77, \"answer_feedback\": \"A change from your usual positions, but an inspiring message to campaign on. It does keep economically-focused voters in your camp instead of the FDP’s - keep in mind you will need them if you are inclined to push through these policies. Your colleague, Former Minister of Finance Wolfgang Schäuble, architect of the “Black Zero”, fears more state debt.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5015, \"fields\": {\"answer\": 4015, \"candidate\": 77, \"answer_feedback\": \"It’s not a bad line persé, but to many, you sound more like a caricature of the FDP or Friedrich Merz - and even he criticized flat tax proposals in the early 2000’s. This is kind of a flip-flop and you’re just not the right person to sell this position in this day and age. Even party insiders deride you as naive behind closed doors.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5016, \"fields\": {\"answer\": 4016, \"candidate\": 77, \"answer_feedback\": \"Some wonder if corruption really has no place in your party, seeing how deep the connections lay, but the media praises you for your strong and steadfast response. Some in your party are nervous about how fast you were to drop your colleagues just like that.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5017, \"fields\": {\"answer\": 4017, \"candidate\": 77, \"answer_feedback\": \"Journalists keep heckling you for more of a comment - this comes off as very suspicious, especially as more and more of these corrupt dealings come to light. When even your son is implicated, you seem to fail your first big challenge as party leader.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5018, \"fields\": {\"answer\": 4018, \"candidate\": 77, \"answer_feedback\": \"Look, <i>Der Spiegel </i>isn’t The Jacobin. Nobody is buying this, as the report is well sourced and new details come out almost every day. This makes you seem very out of touch with the public mood; some right-wingers tentatively praise you, but the AfD more so seeks to profit from government corruption.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5019, \"fields\": {\"answer\": 4019, \"candidate\": 77, \"answer_feedback\": \"At first, your argument seems solid and your base cheers you on - but with time, more and more people, including your own son, are implicated in similar dealings, as your line of defence weakens. You better work on changing the subject.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5020, \"fields\": {\"answer\": 4020, \"candidate\": 77, \"answer_feedback\": \"To your surprise, man of power Markus Söder tells you he wants to become the candidate for the CDU/CSU as well. You both make your intentions public on the same day - and his favorability seems better than yours. This might become ugly…\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5021, \"fields\": {\"answer\": 4021, \"candidate\": 77, \"answer_feedback\": \"Journalists are surprised by what seems like a hasty announcement, but this move was expected at some point. Surprisingly, Markus Söder, leader of the CSU, declares his intention to become the chancellor candidate for the Union as well, some days later. At least it looks like you have a small headstart.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5022, \"fields\": {\"answer\": 4022, \"candidate\": 77, \"answer_feedback\": \"This backfires when the leader of your sister party and enjoyer of the spotlight Markus Söder declares his intention to become the chancellor candidate for the Union the next day after. You’re taken by surprise and quickly follow suit, but this doesn’t make you look good, especially since Söder is quite popular.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5023, \"fields\": {\"answer\": 4023, \"candidate\": 77, \"answer_feedback\": \"Söder is both surprised and grateful. You help him out for the rest of the campaign from the sidelines, and your move is called a humble, but necessary one, as he puts up hell of a fight for the election, “So Germany Stays Stable”.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5024, \"fields\": {\"answer\": 4024, \"candidate\": 77, \"answer_feedback\": \"After several tense days, former Finance Minister and respected eminence Wolfgang Schäuble intervenes on your behalf. With his help, you convince party leadership to declare you as their candidate. Söder is pissed though, and you stand there looking like a coward. Now the pressure is on you to deliver on your slogan: “Making Germany Together”.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5025, \"fields\": {\"answer\": 4025, \"candidate\": 77, \"answer_feedback\": \"While this is true, a lot of people in the CDU also preferred Söder, taken by his machismo and apparent electability. In somewhat of an upset, you narrowly lose the vote and have to have to cheer on Söder for the rest of the campaign. Your career is probably in jeopardy, but he sure puts up a hell of a fight on the campaign trail.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5026, \"fields\": {\"answer\": 4026, \"candidate\": 77, \"answer_feedback\": \"While the vote is closer than you’d like, in the end, you come out victorious and vindicated. Söder accepts the outcome and both of you move on to focus on the upcoming campaign. This whole ordeal rankled some party members though, and your polling is lower than Söders hypotheticals. Now, let’s prove them wrong, “Making Germany Together”!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5027, \"fields\": {\"answer\": 4027, \"candidate\": 77, \"answer_feedback\": \"Party unity is always necessary, and being nice to Söder will help you among his supporters. Your speech comes to no surprise and doesn’t rock the boat, but it serves as a good rallying cry for anyone who might vote for the Christian Democrats.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5028, \"fields\": {\"answer\": 4028, \"candidate\": 77, \"answer_feedback\": \"Trying to capitalize on the winds of change, are we? It’s obvious to onlookers that you’re trying to take a page from Markus Söder’s playbook and some pundits mock you on these pivots, but he did seem to hit a nerve with this rhetoric. Let’s hope emulating him reaps you similar poll numbers.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5029, \"fields\": {\"answer\": 4029, \"candidate\": 77, \"answer_feedback\": \"Admirable sentiments, but a bit meandering. Anyone could have given this speech, and it doesn’t show how you are the candidate to deliver on this. Casting a broad net is good, but this one’s stretching it a bit too thin maybe - pundits keep debating on what your actual government would look like.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5030, \"fields\": {\"answer\": 4030, \"candidate\": 77, \"answer_feedback\": \"You’re right, many people demand change - but you certainly weren’t elected on this premise. The CDU has been in government for almost 16 years now, and Merkel’s allies are lukewarm about your newfound criticism of the Germany she has shaped so thoroughly. It’s doubtful how effective this argument can be from your mouth.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5031, \"fields\": {\"answer\": 4031, \"candidate\": 77, \"answer_feedback\": \"Maybe you’re onto something, after all, the duopoly of CDU and SPD has held for over 70 years - but dismissing Baerbock seems foolish right now, considering the Greens currently poll much higher than at any point in their history. Perhaps you know something the media does not?\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5032, \"fields\": {\"answer\": 4032, \"candidate\": 77, \"answer_feedback\": \"By and large, voters trust the Green party more on these issues, but providing concrete answers helps clarify the record and modernize your image. Söder has tried this before to much praise - just beware of your rural conservative base. There are some with whom these measures are unpopular, and they need a reason to vote for you over radical alternatives.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5033, \"fields\": {\"answer\": 4033, \"candidate\": 77, \"answer_feedback\": \"You’re probably right, but don’t get complacent: you are vying for swing voters with both parties and have lost some ground yourself recently. By keeping Conservatives and Merkel-approvers together, you can come up on top by default. You will probably need one of those parties in your coalition though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5034, \"fields\": {\"answer\": 4034, \"candidate\": 77, \"answer_feedback\": \"This seems very petty, somewhat desperate, even sexist, seeing how Baerbock is the only woman polling that high right now - the media isn’t slow to call you out on this. Also, you might need the Greens as a coalition partner later on, making fun of them like this won’t make you any friends.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5035, \"fields\": {\"answer\": 4035, \"candidate\": 77, \"answer_feedback\": \"You are disparagingly called “Putin understander” by some, though especially in East Germany this position is quite popular. Seeing as how the CDU is traditionally more hawkish, some perceive a certain paradigm shift.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5036, \"fields\": {\"answer\": 4036, \"candidate\": 77, \"answer_feedback\": \"Considering your past statements, this is a bit of a flip-flop and might be perceived as conflict-happy. With public opinion on this matter divided, you have cast your dies very clearly. Polish politicians praise you on social media -  let’s hope you can unite the rest of Europe as chancellor on this topic.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5037, \"fields\": {\"answer\": 4037, \"candidate\": 77, \"answer_feedback\": \"For the majority of people, this is viewed as too lenient towards Russia. Criticizing the transatlantic partnership is also not really in line with your party, longtime americanophile Angela Merkel refuses to comment. At least Gerhard Schröder agrees with you on principle, but don’t expect many SPD voters to cross over on this issue alone.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5038, \"fields\": {\"answer\": 4038, \"candidate\": 77, \"answer_feedback\": \"As much as you might want to, this issue isn’t going away, and you haven’t really pleased anyone with this statement. Your commitment to Nato comes to no surprise and doesn’t register. Don’t be shy to show more backbone!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5039, \"fields\": {\"answer\": 4039, \"candidate\": 77, \"answer_feedback\": \"This is somewhat out of touch with the country’s mood. You give a great soundbite to Green criticism, and make some waves in the media. Even some within your party can read the room, and the new law must comply with the decision either way. At least the AfD doesn’t have anything to gripe about you on this.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5040, \"fields\": {\"answer\": 4040, \"candidate\": 77, \"answer_feedback\": \"You strike a good balance between acknowledging the need to do more and taking the worries of many citizens seriously. This mix of policies plays well in less affluent regions while not aggravating environmentalists.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5041, \"fields\": {\"answer\": 4041, \"candidate\": 77, \"answer_feedback\": \"A fairly vague answer. You tie yourself to Merkel, but others make more waves by commenting more strongly.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5042, \"fields\": {\"answer\": 4042, \"candidate\": 77, \"answer_feedback\": \"Potential Green voters like this approach - the new CDU really seems to take the climate more seriously. Coalition talks with the Greens now ought to be easier. Your own base is unnerved though; what about all the jobs in traditional industry, and what about the energy prices?\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5043, \"fields\": {\"answer\": 4043, \"candidate\": 77, \"answer_feedback\": \"While this stance has its appeals, the majority of people who haven’t had a chance to get vaccinated yet aren’t thrilled - mostly younger voters. Also, some think this might cause a wedge in society, with a certain air of segregation. It is a good compromise if you think opening up is necessary, though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5044, \"fields\": {\"answer\": 4044, \"candidate\": 77, \"answer_feedback\": \"This is a bit more on the cautious side, but overall, quite well received by many corners of society. Some, especially from within FDP and AfD, gripe about ongoing lockdowns - I guess you can’t always make everyone happy. This should definitely keep Covid under control though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5045, \"fields\": {\"answer\": 4045, \"candidate\": 77, \"answer_feedback\": \"Some younger conservatives listen, but with the limited supply of vaccines available, there are not enough doses to vaccinate everyone who wants it. Questioning the prioritization system seems unfair to many older folks in your camp.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5046, \"fields\": {\"answer\": 4046, \"candidate\": 77, \"answer_feedback\": \"This position places you far outside the mainstream - Drosten immediately goes on TV to criticize you, and many of your colleagues start to keep a certain distance from you. A certain part of the population calls you their hero, but they’re not a big electoral prize - prepare for a drop in the polls.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5047, \"fields\": {\"answer\": 4047, \"candidate\": 77, \"answer_feedback\": \"The audience cheers you on, as spending more on defence is always popular in more conservative circles, as is a commitment to the alliance. Not every potential voter is convinced of this, though - the anxiety of war runs deep in Germany’s collective memory.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5048, \"fields\": {\"answer\": 4048, \"candidate\": 77, \"answer_feedback\": \"With how strong the Green Party has been in the polls lately, hitting on them seems like a good strategy. This is a usual attack against them, but even though they seem to move right on defense, it still seems to hit the spot after some of Baerbocks statements on the 2%-goal.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5049, \"fields\": {\"answer\": 4049, \"candidate\": 77, \"answer_feedback\": \"This does little to differentiate you from other parties and is softer on defence than the usual position of your party. It does give you some minor wiggle room on fiscal and foreign policy - be sure to make use of it after the election.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5050, \"fields\": {\"answer\": 4050, \"candidate\": 77, \"answer_feedback\": \"The crowd is silent, some cough in embarrassment. Maybe a few fringe voters will like this statement - everyone else is horrified, especially your party colleagues. Annegret Kramp-Karrenbauer, who got the position of Minister of Defence after her stint as party leader, openly disagrees with your statement.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5051, \"fields\": {\"answer\": 4051, \"candidate\": 77, \"answer_feedback\": \"While his performance was impressive, his strategy was partially built on his incumbency as a “Landesvater”. Still, it might not be a bad message to campaign on good governance. “For a Germany, in which we live well and gladly”, as Merkel advertised 4 years ago.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5052, \"fields\": {\"answer\": 4052, \"candidate\": 77, \"answer_feedback\": \"The need to win back AfD voters is definitely something that most parties can agree on - hopefully, your focus on this front can actually yield electoral success. It’s unlikely they’ll exit the parliament, but maybe Haseloff has some good advice.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5053, \"fields\": {\"answer\": 4053, \"candidate\": 77, \"answer_feedback\": \"Haseloff is glad to campaign with you. You definitely show your appreciation of Saxony-Anhalt, and East Germany notices. On your end, you enjoy some local </i> Rotkäppchen </i>and <i>Baumkuchen </i>as well as a visit to Martin Luther's hometown, the Lutherstadt Wittenberg.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5054, \"fields\": {\"answer\": 4054, \"candidate\": 77, \"answer_feedback\": \"You’re right that this is important, and in line with the current government's strategy - but many blame your party for the current misery. Maybe it’s best not to focus on continuing the last 16 years here. Furthermore, some say these measures don’t go far enough, especially the FDP, who have staked out digitalization as their favourite topic.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5055, \"fields\": {\"answer\": 4055, \"candidate\": 77, \"answer_feedback\": \"A fatalistic approach, but a reasonable one. Young voters are disappointed by your lack of a proper position on digitalization, but better not to fan the flames lest you burn yourself. Some Union officials are a bit peeved that you aren’t talking about their purported successes, but even they can read the numbers.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5056, \"fields\": {\"answer\": 4056, \"candidate\": 77, \"answer_feedback\": \"Most parties are calling for something like this, and you don’t differentiate yourself from them.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5057, \"fields\": {\"answer\": 4057, \"candidate\": 77, \"answer_feedback\": \"This is a strong promise that will especially help you in less urban areas.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5058, \"fields\": {\"answer\": 4058, \"candidate\": 77, \"answer_feedback\": \"This response will help you in those areas, though some say that this is the least you can do.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5059, \"fields\": {\"answer\": 4059, \"candidate\": 77, \"answer_feedback\": \"Many wonder why your own state government had no such crisis team despite weather warnings.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5060, \"fields\": {\"answer\": 4060, \"candidate\": 77, \"answer_feedback\": \"Your own state government restricted emergency aid in such situations two years ago. This makes you seem opportunistic.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5061, \"fields\": {\"answer\": 4061, \"candidate\": 77, \"answer_feedback\": \"Explicitly connecting this to climate change might help the Green Party more than you.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5062, \"fields\": {\"answer\": 4062, \"candidate\": 77, \"answer_feedback\": \"You are accused of being missing in action, but this might be safer.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5063, \"fields\": {\"answer\": 4063, \"candidate\": 77, \"answer_feedback\": \"Being seen helps you locally, but without cameras, the nation is a bit confused about what you are doing.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5064, \"fields\": {\"answer\": 4064, \"candidate\": 77, \"answer_feedback\": \"Oh no! A photo of you laughing during the visit is circulating in the media! People across the political spectrum criticize you for not taking the situation seriously.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5065, \"fields\": {\"answer\": 4065, \"candidate\": 77, \"answer_feedback\": \"There are some tense moments and you have some awkward conversations. At least you get some neutral-to-positive media attention.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5066, \"fields\": {\"answer\": 4066, \"candidate\": 77, \"answer_feedback\": \"This is a very strong statement, and coal-producing regions are unhappy with this pivot. Still, this could win over some green voters.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5067, \"fields\": {\"answer\": 4067, \"candidate\": 77, \"answer_feedback\": \"You won’t win over Green voters like this, but your base is pleased.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5068, \"fields\": {\"answer\": 4068, \"candidate\": 77, \"answer_feedback\": \"The statement is seen as tone-deaf by many.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5069, \"fields\": {\"answer\": 4069, \"candidate\": 77, \"answer_feedback\": \"This is a controversial topic with people on both sides of the argument. It doesn’t help that the decision to stop relying on nuclear energy was originally made by Merkel.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5070, \"fields\": {\"answer\": 4070, \"candidate\": 77, \"answer_feedback\": \"Compulsory vaccination is unpopular, but this won’t help the vaccination campaign.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5071, \"fields\": {\"answer\": 4071, \"candidate\": 77, \"answer_feedback\": \"This statement is received quite well overall and might make vaccinations more attractive. You might lose voters sceptical about vaccinations though.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5072, \"fields\": {\"answer\": 4072, \"candidate\": 77, \"answer_feedback\": \"You win over some anti-Covid Querdenker. The rest of the country is deeply confused by this statement.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5073, \"fields\": {\"answer\": 4073, \"candidate\": 77, \"answer_feedback\": \"You’ve positioned yourself at the fringe of the conversation, compulsory vaccinations are generally unpopular.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5074, \"fields\": {\"answer\": 4074, \"candidate\": 77, \"answer_feedback\": \"Unfortunately, the video is widely mocked. Meanwhile, the SPD keeps surging.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5075, \"fields\": {\"answer\": 4075, \"candidate\": 77, \"answer_feedback\": \"The topic isn’t quite as important anymore as it was in the spring, and the vaccination campaign isn’t going all that great. Meanwhile, the SPD keeps surging.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5076, \"fields\": {\"answer\": 4076, \"candidate\": 77, \"answer_feedback\": \"The spot is somewhat well-received but unlikely to sway many voters. Meanwhile, the SPD keeps surging.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5077, \"fields\": {\"answer\": 4077, \"candidate\": 77, \"answer_feedback\": \"You’re quite popular as Prime Minister. It helps to remind people of that. Meanwhile, the SPD still keeps surging.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5078, \"fields\": {\"answer\": 4078, \"candidate\": 77, \"answer_feedback\": \"This is your expected answer, but needling Scholz and Baerbock on their unclear statements towards the Left party plays well with your base.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5079, \"fields\": {\"answer\": 4079, \"candidate\": 77, \"answer_feedback\": \"You’re right, though another grand coalition might be a good path to power for you, and this makes it a harder sell after the election.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5080, \"fields\": {\"answer\": 4080, \"candidate\": 77, \"answer_feedback\": \"This goes against everything you and other CDU politicians have been saying. A coalition containing the AfD is poison to moderate voters, and both the SPD and the Green party rule out a coalition with you in turn. Meanwhile, the AfD is not enthusiastic to elect you, a moderate, chancellor.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5081, \"fields\": {\"answer\": 4081, \"candidate\": 77, \"answer_feedback\": \"It’s unlikely that black-yellow will have a majority, but one can dream.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5082, \"fields\": {\"answer\": 4082, \"candidate\": 77, \"answer_feedback\": \"Many see your analysis as correct, but wanted to hear more about what you wanted to do now.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5083, \"fields\": {\"answer\": 4083, \"candidate\": 77, \"answer_feedback\": \"It’s unclear how you want to actually evacuate them, but the sentiment is appreciated. Some also fear the AfD could profit from a new wave of refugees.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5084, \"fields\": {\"answer\": 4084, \"candidate\": 77, \"answer_feedback\": \"The SPD retorts by blaming the CDU-led defence ministry. This mudslinging is unproductive.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5085, \"fields\": {\"answer\": 4085, \"candidate\": 77, \"answer_feedback\": \"This keeps the AfD at bay, but is sharply criticized by more left-wing parties. Also, people don’t believe that you specifically are the right person for tough migration policies.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5086, \"fields\": {\"answer\": 4086, \"candidate\": 77, \"answer_feedback\": \"It seems right now like Scholz has become your main opponent, so this seems like a prudent choice.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5087, \"fields\": {\"answer\": 4087, \"candidate\": 77, \"answer_feedback\": \"Her numbers keep slipping, but there might be an argument that there are voters to be won back from her.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5088, \"fields\": {\"answer\": 4088, \"candidate\": 77, \"answer_feedback\": \"Let’s hope taking the high road helps you stand out!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5089, \"fields\": {\"answer\": 4089, \"candidate\": 77, \"answer_feedback\": \"Many question your judgment. This makes it look to people like the race is between Baerbock and Scholz.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5090, \"fields\": {\"answer\": 4090, \"candidate\": 77, \"answer_feedback\": \"Scholz is in a bit of an awkward spot with this attack and doesn’t give a clear answer. Overall, you and Baerbock tie the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5091, \"fields\": {\"answer\": 4091, \"candidate\": 77, \"answer_feedback\": \"A damaging attack, but he and Baerbock hit back by mentioning corruption in your party like the mask dealings earlier this year. Baerbock is seen as the overall winner of the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5092, \"fields\": {\"answer\": 4092, \"candidate\": 77, \"answer_feedback\": \"You might have had an opening there, but the second part is an odd avenue of attack considering the CDU had a coalition government with the SPD for the past eight years. Scholz rebukes this rather easily and is seen as the winner of the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5093, \"fields\": {\"answer\": 4093, \"candidate\": 77, \"answer_feedback\": \"Since you haven’t prepared for this strategy, this doesn’t help you. Scholz is seen as the winner of the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5094, \"fields\": {\"answer\": 4094, \"candidate\": 77, \"answer_feedback\": \"This is something she struggled with in the past, so the attack is quite damaging. Overall, you and Scholz tie the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5095, \"fields\": {\"answer\": 4095, \"candidate\": 77, \"answer_feedback\": \"This devolves into a heated back and forth between the two of you with no clear winner. Scholz wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5096, \"fields\": {\"answer\": 4096, \"candidate\": 77, \"answer_feedback\": \"Many Green voters aren’t against this potential coalition, so this attack isn’t all that effective. Overall, Scholz wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5097, \"fields\": {\"answer\": 4097, \"candidate\": 77, \"answer_feedback\": \"Since you haven’t prepared for this strategy, this doesn’t help you. Overall, Scholz wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5098, \"fields\": {\"answer\": 4098, \"candidate\": 77, \"answer_feedback\": \"Baerbock criticises you sharply, and you are drawn into back-and-forths after all. Overall, Scholz wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5099, \"fields\": {\"answer\": 4099, \"candidate\": 77, \"answer_feedback\": \"This works, you convince voters worried about how Scholz and Baerbock want to pay for their proposals and potential tax hikes. You win the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5100, \"fields\": {\"answer\": 4100, \"candidate\": 77, \"answer_feedback\": \"After 16 years of Merkel, the country is ready for a change, so this declaration isn’t all that popular. Overall, Scholz wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5101, \"fields\": {\"answer\": 4101, \"candidate\": 77, \"answer_feedback\": \"You come across as unprepared and overly aggressive. This doesn’t help you at all and overall, Scholz wins the debate.\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5102, \"fields\": {\"answer\": 4102, \"candidate\": 77, \"answer_feedback\": \"This will help you keep the right wing of your party in line. Good luck tonight!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5103, \"fields\": {\"answer\": 4103, \"candidate\": 77, \"answer_feedback\": \"The outgoing chancellor herself is still very popular, so this should rally some voters.  Good luck tonight!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5104, \"fields\": {\"answer\": 4104, \"candidate\": 77, \"answer_feedback\": \"Hopefully this will keep the AfD in line.  Good luck tonight!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5105, \"fields\": {\"answer\": 4105, \"candidate\": 77, \"answer_feedback\": \"He is definitely popular and happy to campaign with you in his home state. Good luck tonight!\"}}, {\"model\": \"campaign_trail.answer_feedback\", \"pk\": 5106, \"fields\": {\"answer\": 4106, \"candidate\": 77, \"answer_feedback\": \"You’re right of course, and you do keep the attention on Baerbocks scandals. That said, you also push voters away from your own successes, and during all the sniping and back-and-forths, Olaf Scholz is recently seen more often with his signature “smurfy grin”.)\"}}]");
